import React, {Component} from 'react';
import './Homepage.css';
import './css/main.css';
import './css/util.css';

function Homepage({name, backhome}) {
    return (
        <div >
            {
                <div>
                    <h1>Welcome, {name}.</h1>
                    <button onClick={this.props.backhome} className="container-login100-form-btn">Logout!</button>
                </div>
            }
        </div>
    )
}
export default Homepage;
